  /**
   * Erstellt einen Agenten basierend auf dem Typ
   */
  private async createAgent(type: string): Promise<DevelopmentAgent> {
    const { [type]: AgentClass } = await import(`../agents/${type}-agent`);
    return new AgentClass();
  }

  /**
   * Sammelt den Status aller Agenten
   */
  private async collectAgentStatuses(): Promise<AgentStatus[]> {
    const statuses: AgentStatus[] = [];
    
    for (const agent of this.agents.values()) {
      try {
        const status = await agent.getStatus();
        statuses.push(status);
      } catch (error) {
        console.error(`❌ Fehler beim Sammeln des Status von Agent ${agent.id}:`, error);
      }
    }
    
    return statuses;
  }

