  /**
   * Gibt Statistiken über den Schwarm zurück
   */
  async getSwarmStatistics(): Promise<any> {
    const agentStatuses = await this.collectAgentStatuses();
    const systemHealth = await this.getSystemHealth();
    const performanceMetrics = await this.monitor.getPerformanceMetrics();

    return {
      totalAgents: this.agents.size,
      activeAgents: agentStatuses.filter(s => s.isActive).length,
      systemHealth,
      performanceMetrics,
      coordinationStatus: {
        isRunning: this.isRunning,
        lastCycle: new Date(),
        cyclesCompleted: 0 // TODO: Implementieren
      }
    };
  }

